CREATE DATABASE devhub;


CREATE TABLE usuario(
    id INT PRIMARY KEY AUTO_INCREMENT,
    nome VARCHAR(100),
    idade INT,
    email VARCHAR(100) UNIQUE,
    senha VARCHAR(100)
);

CREATE TABLE lgs(
	id INT PRIMARY KEY AUTO_INCREMENT,
	categoria TEXT,
    horas_trabalhadas INT,
    linhas_codigo INT,
    bugs_corrigidos INT
);

CREATE TABLE `like` (
  `log_id` int NOT NULL,
  `user_id` int NOT NULL,
  KEY `fk_log_idx` (`log_id`),
  KEY `fk_user_idx` (`user_id`),
  CONSTRAINT `fk_log` FOREIGN KEY (`log_id`) REFERENCES `lgs` (`id`),
  CONSTRAINT `fk_user` FOREIGN KEY (`user_id`) REFERENCES `usuario` (`idusuario`)
)



CREATE TABLE `devhub`.`comment` (
  `log_id` INT NOT NULL,
  `user_id` INT NOT NULL,
  `mesage` VARCHAR(255) NULL,
  CONSTRAINT `fk_log_comment` FOREIGN KEY (`log_id`) REFERENCES `lgs` (`id`),
  CONSTRAINT `fk_user_comment` FOREIGN KEY (`user_id`) REFERENCES `usuario` (`idusuario`));

USE devhub;
